    [],nt"revision_timestamp": "2015-12-20T18:45:10.646395",nt"name": "tropical-cyclone-exposure-for-u-s-waters-within-the-eastern-pacific-ocean-basin-1900-2013",nt"isopen":
    false,nt"url": null,nt"notes": "These data represent modeled, historical
    exposure of U.S. offshore and coastal waters to tropical cyclone activity within
    the Eastern Pacific Ocean basin. BOEM Outer Continental Shelf Lease Blocks and equivalent
    areas for coastal waters were used to construct the grid by which exposure was quantified.
    Exposure was quantified using intersecting storm tracks, overlapping wind intensity
    areas, and mathematical return intervals. Symbology is based on the modeled occurrence
    of tropical storm force (34-knot) or greater winds per lease block. Wind climatology
    was based on Extended Best Track re-analysis data, using overwater wind data only.
    Due to the exclusion of inland wind values used within the model outputs, the interpretation
    of wind exposure metrics within coastal waters should be interpreted carefully.
    Storm tracks were provided by International Best Track Archive for Climate Stewardship
    (IBTrACS) data for the period 1900-2013. Data represent past climatology only and
    do not suggest predicted future impacts or exposure.",nt"license_title": null,nt"extras":
